import React from 'react';
import '../Styles/App.css';
import {Header, Divider, Grid, Button, Image} from 'semantic-ui-react'

class About extends React.Component {


    render() {

        return(

            <>
                <Header as='h1' textAlign='center' className="header-about" dividing>
                    About me
                </Header>

                <Grid columns={3}>

                        <Grid.Column className='red'>
                                <Image src={require('../Photos/dawid.png')} />
                        </Grid.Column>

                </Grid>


            </>
        )
    }
}

export default About
